// Omit specific keys from the JSON object
const keysToOmit = '{{ keys | default('password,secret') }}'.split(',').map(k => k.trim());

return items.map(item => {
  const newItem = { ...item.json };
  keysToOmit.forEach(key => {
    delete newItem[key];
  });
  return { json: newItem };
});
